(64, 'LORDIBRA Group', 'SICAP Liberté 6 extension – 47, Cité ASECNA – CP: 11000 – (Dakar/Sénégal)', 'Sénégal', '+221 30 114 00 08', NULL, 'direction@lordibra.net', 'www.lordibra.net', NULL, '20', '2013-06-15', '1 à 9', 'Spécialisée dans le conseil, la création graphique et la production multimédia, LORDIBRA Group SARL est une agence de communication qui intervient à l’international.\r\n\r\nNotre équipe accompagne les acteurs privés et institutionnels qui souhaitent valoriser leurs activités à travers la création de supports de communication.\r\n\r\nNous appuyons également les jeunes entrepreneurs et opérateurs culturels présents sur le continent.\r\n\r\nNotre expertise s’attache essentiellement au conseil en stratégie de communication, à la création graphique, à l’imprimerie, aux solutions web ainsi qu’à la production audio-visuel.', NULL, 'TIC', 'Services aux entreprises', 'Sous-traitance', 'Donneur d’ordres', 'Prestataire de services', 'Consultant', NULL, 'Services aux entreprises', 'Agriculture et agro-alimentaire', 'Industrie textile', 'Investisseur', 'Donneur d’ordres', 'Fabricant/Producteur', 'Burkina Faso,Sénégal,Mauritanie,Guinée Bissau,...', 'Alliance commerciale,Alliance financière,Alliance technologique,Alliance industrielle,non renseigné', 'Monsieur', 'TRAORE', 'Adji Ibrahim', NULL, 'direction@lordibra.net', '762234866', 'AVEC un planning B 2 B', 'Francais', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Cérémonie Officielle d’Ouverture,Opportunités d investissement privés, secteurs prioritaires et perspectives d intervention.,Renforcer les relations entre le secteur public et le secteur privé (Rencontres G to G et G to B),Construire des relations économiques et commerciales solides entre le secteur privé (B to B),Visites d Entreprises (Parc industriel de Diamniadio, autres sociétés privées d intérêt),Consolider les relations culturelles (Animation culturelle, prestation d artistes, dégustation de mets Burkinabè),...', 'jpec2019', 9