(113, 'Fonds Burkinabè de Développement Économique et Social (Fbdes)', NULL, 'Burkina faso', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '--Selectionner--', 'Le Fbdes est un fonds national de financement avec pour objectif de soutenir des opérations de développement par des prises de participation dans des sociétés en création et en croissance, des crédits d investissement au PME/PMI.\r\nLe Fonds, créé en 1998, est une émanation du Fonds de voltaïsation des capitaux.\r\nSes interventions majeures ont porté sur le financement des secteurs stratégiques, comme l énergie, le coton, banque et assurance, l élevage.\r\nDes PME ont bénéficié de l accompagnement du Fonds pour développer ou réaliser des investissements dans le domaine de la santé, du transport, de l éducation, de l agro industrie, des BTP etc...\r\nPlusieurs opérations de soutien aux jeunes pousses dans le cadre du Burkina Star up, de financement de l auto emploi des jeunes diplômés, du secteur informel et l entrepreneuriat féminin.', NULL, 'Services aux entreprises', 'Autres', 'Autres', 'Investisseur', 'Investisseur', 'Investisseur', 'Investisseurs ou porteurs de projets dans les domaines à forte valeur ajoutée et de création d\'emplois.', 'Agriculture et agro-alimentaire', 'Industrie manufacturière', 'Services aux entreprises', 'Fabricant/Producteur', 'Investisseur', 'Innovation, R&D', 'Burkina Faso,Sénégal,Mauritanie,...', 'non renseigné', 'Monsieur', 'Gnada', 'Mamoudou', NULL, 'gnadamour@yahoo.fr', '+22670239665', 'AVEC un planning B 2 B', '--Selectionner--', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Cérémonie Officielle d’Ouverture,Opportunités d investissement privés, secteurs prioritaires et perspectives d intervention.,Renforcer les relations entre le secteur public et le secteur privé (Rencontres G to G et G to B),Construire des relations économiques et commerciales solides entre le secteur privé (B to B),Visites d Entreprises (Parc industriel de Diamniadio, autres sociétés privé