(115, 'Agence de Financement et de Promotion des Petites et Moyennes Entreprises (AFP-PME)', '01 BP 1777 Ouagadougou 01', 'Burkina Faso', '00226 25 31 83 11', '00226 25 31 83 14', 'direction@afppme.bf', 'www.afppme.bf', NULL, NULL, '2008-12-30', '25 à 49', 'L\'AFP-PME est un Etablissement Public d\'Etat de la catégorie des Fonds Nationaux de Financement (FNF). Sa mission principale est de promouvoir les PME par une offre de produits financiers sous forme de crédits à courts, moyens et longs termes et non financiers sous forme d\'information, de formation, d\'appui conseil, d\'incubation et d\'accélération de projets d\'entreprise. Sa cible est toute personne physique ou morale, disposant d\'un projet d\'entreprise, mis en ouevre ou qui sera mis en oevre sur le teritoire du Burkina Faso, dans les 03 secteurs d\'activités economiques.', '- Financement de PME\r\n- Formation\r\n- Appui-conseil\r\n- Incubation et accélération de projets d\'entreprises', 'Agriculture et agro-alimentaire', 'Industrie textile', 'Industrie manufacturière', 'Donneur d’ordres', 'Investisseur', '--Selectionner--', 'Parténaires techniques et financiers', 'Agriculture et agro-alimentaire', 'Industrie textile', 'Industrie manufacturière', 'Investisseur', 'Donneur d’ordres', 'Distributeur', 'Burkina Faso,Sénégal,Mauritanie,Gambie,Guinée Bissau,Cap-Vert,non renseigné', 'Alliance financière,Alliance technologique,non renseigné', 'Monsieur', 'KIETYETA', 'Kiswendsida Honoré', 'Directeur Général', 'kietyeta@gmail.com', '00226 76 60 15 00', 'Je souhaite partciper aux JPEC avec un planning de rendez-vous B 2 B', 'Francais', '2018-07-06', NULL, NULL, '2019-07-16', NULL, NULL, NULL, NULL, 'Burkinabé', 'non renseigné', 'jpec2019', 161, '2019-06-30 12:06:54', '2019-06-30 12:14:10'),
