(42, 'CAISSE NATIONALE DE SECURITE SOCIALE', NULL, 'Burkina faso', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '--Selectionner--', 'La Caisse nationale de sécurité sociale (CNSS) du Burkina Faso est chargée de l’administration du régime de sécurité sociale en faveur des travailleurs salariés des secteurs privé  et  parapublic.  Elle  distribue  à  ces  travailleurs  et  à  leurs  familles,  trois  types  de prestations réparties entre trois branches :\r\n•	des allocations familiales et des allocations de maternité (prestations familiales),\r\n•	des prestations en matière de risques professionnels (risques professionnels),\r\n•	des prestations de vieillesse, d’invalidité et de décès (assurance vieillesse).\r\nCes prestations sont complétées par une action sanitaire et sociale.', NULL, 'Autres', '--Selectionner--', '--Selectionner--', 'Autres', '--Selectionner--', '--Selectionner--', 'Rencontres avec le secteur informels burkinabé et sénégalais en vue de mieux faire connaitre l\'assurance volontaire;\r\nPromotion de l\'assurance volontaire*\r\nVisibilité des missions  de la CNSS auprès des partenaires', 'Autres', '--Selectionner--', '--Selectionner--', 'Autres', '--Selectionner--', '--Selectionner--', 'Burkina Faso,Sénégal,Mauritanie,Gambie,Guinée Bissau,Cap-Vert,...', 'non renseigné', NULL, 'KONE', 'DILOMAMA', NULL, 'dilomama.kone@cnss.bf', '70179720', 'AVEC un planning B 2 B', '--Selectionner--', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Renforcer les relations entre le secteur public et le secteur privé (Rencontres G to G et G to B),Construire des relations économiques et commerciales solides entre le secteur privé (B to B),...', 'jpec2019', 69, '2019-06-24 10:50:46', '2019-06-24 10:50:46'),
