(65, 'Groupe dradia', 'Dakar - parcelles assainies u12', 'Sénégal', '776962428- 338355548', NULL, 'Groupedradi@gmail.com', NULL, NULL, NULL, '2013-01-31', '1 à 9', 'Groupe dradia est une entreprise qui exel dans plusieurs domaines notamment dans le domaine de l’agriculture et l’aviculture. \r\nL’aviculture est notre principal activité avec une production de 2000 poulets par mois, un chiffre qui devrait augmenter d’ici quelques mois avec l’arrivée prochaine de potentiel partenaire tel que les grandes surfaces. \r\nL’agriculture, la seconde activité de l’entreprise est basée sur la culture maraîchère et la culture de maïs avec des programmes et des partenariats avec les entreprises qui fabriquent des aliments de volailles et un programme appelé \"mon casier de légume chez moi\".', NULL, 'Agriculture et agro-alimentaire', 'Autres', 'Autres', 'Fabricant/Producteur', 'Distributeur', 'Autres', 'Je suis à la recherche d’un partenaire financier qui pourra permettre à l’entreprise de grandir, de prendre une autre dimension afin de pouvoir diversifier les activités de l’entreprise et s’ouvrir en même temps à l’étranger.', 'Agriculture et agro-alimentaire', 'Autres', 'Distribution', 'Investisseur', 'Importateur', 'Autres', 'Sénégal,...', 'Alliance commerciale,Alliance financière,non renseigné', 'Monsieur', 'Oussouphi', 'Drame', NULL, 'groupedradia@gmail.com', '221776962428', 'AVEC un planning B 2 B', 'Francais', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Cérémonie Officielle d’Ouverture,Opportunités d investissement privés, secteurs prioritaires et perspectives d intervention.,Renforcer les relations entre le secteur public et le secteur privé (Rencontres G to G et G to B),Construire des relations économiques et commerciales solides entre le secteur privé (B to B),Visites d Entreprises (Parc industriel de Diamniadio, autres sociétés privées d intérêt),Consolider les relations culturelles (Animation culturelle, prestation d artistes, dégustation de mets Burkinabè),...', 'jpec2019', 78, '2019-06-26 14:08:54', '2019-06-26 14:08:54'),
(66, 'CGF Bourse', NULL, 'Sénégal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '--Selectionner--', 'Créée en 1998, la Compagnie de Gestion Financière et de Bourse, CGF Bourse, est une Société Anonyme au capital de 1,5 milliard de FCFA. CGF Bourse est une Société de Gestion et d\'Intermédiation (SGI) agréée sur le marché financier de l\'UEMOA par le Conseil Régional de l\'Epargne Publique et des Marchés Financiers (CREPMF).\r\n\r\nCGF Bourse capitalise des références dans plusieurs domaines d’activités notamment la levée de fonds en capital ou en titres de créances permettant de disposer d’une source de financement à long terme, le conseil et l’assistance dans la conduite d’un processus de fusion, de cession ou d’acquisition, la restructuration financière, la mise en place de l’actionnariat salarié et l’ouverture de capital par appel public à l’épargne… \r\n\r\nA travers notre filiale d’asset management dénommée CGF Gestion, nous œuvrons dans la création de produits dédiés permettant d’effectuer des levées de fonds ciblés ou auprès du grand public, la création et la gestion de fonds de pension de retraite complémentaire pour le personnel salarié et la création de fonds de placement pour la trésorerie excédentaire de l\'entreprise.\r\n\r\nCGF offre ainsi, une large gamme de services financiers à une clientèle diversifiée constituée d’Etats, de sociétés industrielles et commerciales, d’institutions financières, de collectivités locales et de personnes physiques. CGF se mobilise constamment pour être le pionner sur son marché et proposer une approche à la fois alternative et exclusive de satisfaction des besoins financiers de ses clients.\r\n\r\nCGF Bourse est la 1ère SGI Ouest africaine de l’espace UEMOA notée en Qualité de Gestion « QSG-1, 5 étoiles » (par l\'agence EMR-WARA) et certifiée ISO 9001 (par VERITAS).', NULL, 'Services aux entreprises', '--Selectionner--', '--Selectionner--', 'Prestataire de services', '--Selectionner--', '--Selectionner--', 'Investisseurs', 'Industrie manufacturière', 'Agriculture et agro-alimentaire', 'Energie', 'Investisseur', 'Fabricant/Producteur', 'Distributeur', 'Burkina Faso,Sénégal,Guinée Bissau,...', 'non renseigné', 'Monsieur', 'DEME', 'Oumar', NULL, 'odeme@cgfbourse.com', '221774508913', 'AVEC un planning B 2 B', '--Selectionner--', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Cérémonie Officielle d’Ouverture,Opportunités d investissement privés, secteurs prioritaires et perspectives d intervention.,Renforcer les relations entre le secteur public et le secteur privé (Rencontres G to G et G to B),Construire des relations économiques et commerciales solides entre le secteur privé (B to B),Visites d Entreprises (Parc industriel de Diamniadio, autres sociétés privées d intérêt),Consolider les relations culturelles (Animation culturelle, prestation d artistes, dégustation de mets Burkinabè),...', 'jpec2019', 98, '2019-06-26 14:45:43', '2019-06-26 14:45:43'),
