(68, 'GOUBA AVOCATS', NULL, 'Burkina faso', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '--Selectionner--', 'GOUBA AVOCATS est un cabinet d’avocats expérimenté couvrant tous les domaines liés aux droits des affaires : fusions-acquisitions, fonds d’investissements, financements structurés, restructurations et procédures collectives, droit social, droit des TIC, droit pénal des affaires, droit de la concurrence, droit des sociétés, droit des marchés publics, droit de la construction et du génie civil, droit fiscal.\r\n Dans ces domaines, notre expertise recouvre le conseil, la négociation et structuration des opérations, la rédaction des contrats, le contentieux, l’arbitrage et la médiation.\r\nGOUBA AVOCATS intervient pour une clientèle variée d’entreprises de toutes tailles, de personnes morales et de personnes physiques, dirigeants, actionnaires et entrepreneurs, burkinabé ou étrangers, intervenant notamment dans les secteurs des hautes technologies, de l’informatique, de la défense, des fonds d’investissement, de l’agro-alimentaire, de la construction, de l’énergie, du cinéma, des médias et de la culture, de la santé et du sport.', NULL, 'Services aux entreprises', 'Services aux entreprises', '--Selectionner--', 'Prestataire de services', 'Consultant', 'Autres', 'Le cabinet GOUBA AVOCATS cherche à nouer les relations avec:\r\n- les investisseurs ou entreprises qui voudraient faire des affaires au Burkina Faso;\r\n- les cabinets d\'avocats étrangers pour une collaboration;', 'Agriculture et agro-alimentaire', 'Energie', 'TIC', 'Investisseur', 'Importateur', 'Distributeur', 'Burkina Faso,Sénégal,Mauritanie,Guinée Bissau,Cap-Vert,...', 'non renseigné', 'Monsieur', 'GOUBA', 'ODILON ABDOU', NULL, 'goubaodilon@gouba-avocats.com', '00226 71 52 31 24', 'AVEC un planning B 2 B', '--Selectionner--', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Cérémonie Officielle d’Ouverture,Opportunités d investissement privés, secteurs prioritaires et perspectives d intervent